import React, { useState, useEffect } from 'react';
import './Profile.css';
import axios from 'axios'; // Assuming you're using axios for HTTP requests

const Profile = () => {
  const [profileDetails, setProfileDetails] = useState(null);

  useEffect(() => {
    // Fetch user profile details from the backend
    axios.get('/SignUp') // Adjust the endpoint according to your backend setup
      .then(response => {
        setProfileDetails(response.data);
      })
      .catch(error => {
        console.error('Error fetching profile:', error);
      });
  }, []);

  return (
    <div className="Profile-bg">
      <div className='profile-container'>
        <div className='profile-card'>
          <div className='profile-header'>
            <h1>Profile Details</h1>
          </div>
          <div className='profile-details'>
            {profileDetails && (
              <>
                <div className='detail'>
                  <span className='label'>Name:</span>
                  <span className='value'>{profileDetails.name}</span>
                </div>
                <div className='detail'>
                  <span className='label'>Email:</span>
                  <span className='value'>{profileDetails.email}</span>
                </div>
                <div className='detail'>
                  <span className='label'>Occupation:</span>
                  <span className='value'>{profileDetails.occupation}</span>
                </div>
                <div className='detail'>
                  <span className='label'>Location:</span>
                  <span className='value'>{profileDetails.location}</span>
                </div>
              </>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
